import React, { useState } from "react";
import "./event-list.css";
import axios from "axios";
export function EventList({ events }) {
  const [weather, setWeather] = useState([]);



  return (
    <div>
      {events.map((e) => (
        <div className="events" key={e.id}>
          {e.summary}

          <p>{e.location}</p>
        </div>
      ))}
    </div>
  );
}
